import React from "react";
import "../App.css";
import { Tabs, TabList, Tab } from '@chakra-ui/react'


function HeaderBar() {
    return (
      <Tabs position='relative' variant='unstyled'>
  <TabList>
      <Tab _hover={{}}>One</Tab>
    <Tab>Two</Tab>
    <Tab>Three</Tab>
  </TabList>
</Tabs>
    );
    }

export default HeaderBar;
